import './App.css';
import About from './components/About';
import Chart from './components/Chart.js';

function App() {
	return (
		<div className='app'>
			<div>
				<Routes>
					<Route path='/' element={<Chart />} />
					<Route path='/login' element={<Auth />} />
					<Route path='/about' element={<About />} />
				</Routes>
			</div>
		</div>
	);
}

export default App;
